import React from 'react'
import { NavLink } from 'react-router-dom'
import logo from '../images/logo.jpeg'


const  Navbar=() =>{
    return (
        <>
          <nav>
              <NavLink to="/" className="pl-8"><img className="object-contain h-48 w-full" src={logo} alt="CODINGAL" /></NavLink>
          </nav>  
        </>
    )
}

export default Navbar
